const AnimatedPokemonCard = ({ pokemons }) => {
    {
        pokemons().map((pokemon) => (
            <div
                key={pokemon.id}
                style={calculatePokemonStyle(pokemon)}
                onClick={() => togglePokemon(pokemon.id)}
                className="col-md-4 mb-4 justify-content-center align-items-center d-flex align-items-stretch animated"
            >
                <PokemonCard pokemon={pokemon} />
            </div>
        ))
    }
};
export default AnimatedPokemonCard;
